const addNavigationFunction =(nav )=>{
  let sessionName = document.getElementById("selector").value.split('-');
  let newLink = document.getElementById("newLink").value;
  
  if(!sessionName[0] && !newLink){
    let errorMsg = "please add a room link or select from the list";
    document.getElementById("popupError").innerHTML = errorMsg;
    return
  }
  if(!!sessionName[0]){
    document.getElementsByClassName("notification50centralizercontainer")[0].parentElement.remove();
      nav.setAttribute("navLink", sessionName[0])
      nav.setAttribute("isNewLink", "off")
      nav.querySelector("#text").innerHTML = sessionName[1]
      // nav.getElementById("dd").innerHTML = "To "
      
      return;
    }
    if(newLink){
      let isValid =  /(\.|\/|^)Gobrunch\.com(\/.*)?$/i.test(newLink)
      if(isValid){

              let arr = newLink.split('/') 
              
              document.getElementsByClassName("notification50centralizercontainer")[0].parentElement.remove();
               nav.setAttribute("navLink", newLink)
               nav.setAttribute("isNewLink", "on")
               nav.querySelector("#text").innerHTML = arr[arr.length-1]
              //  nav.getElementById("dd").innerHTML = "To "
              }else{
                let errorMsg = "please add a Valid GoBrunch link";
                document.getElementById("popupError").innerHTML = errorMsg;
                return ;  
              }

  } 

  
}
