// Initializer functions
function initializer() {
  clearExistedHighlight();
  initializerWithoutClearHighlight();
}
function initializerWithoutClearHighlight() {
  moveCircle = false;
  document.body.style.cursor = "default";
  addCircle = false;
}

function clearEditorIconHighlight() {
  let icons = document.getElementsByClassName("editoriconexternal");
  for (let i of icons) {
    i.classList.remove("darkglass3selected");
  }
}
